class Droplet:
    def __init__(self, x, y, vx, vy, r):
        self.x = x
        self.y = y
        self.vx = vx
        self.vy = vy
        self.r = r
        self.area = math.pi * r ** 2

    def __str__(self):
        return f'Droplet(x={self.x}, y={self.y}, vx={self.vx}, vy={self.vy}, r={self.r})'

    def __repr__(self):
        return self.__str__()

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y and self.vx == other.vx and self.vy == other.vy and self.r == other.r

    def __hash__(self):
        return hash((self.x, self.y, self.vx, self.vy, self.r))

    def __lt__(self, other):
        return self.area < other.area

    def __gt__(self, other):
        return self.area > other.area

    def __le__(self, other):
        return self.area <= other.area

    def __ge__(self, other):
        return self.area >= other.area

    def __add__(self, other):
        return Droplet(self.x + other.x, self.y + other.y, self.vx + other.vx, self.vy + other.vy, self.r + other.r)

    def __sub__(self, other):
        return Droplet(self.x - other.x, self.y - other.y, self.vx - other.vx, self.vy - other.vy, self.r - other.r)

    def __mul__(self, scalar):
        return Droplet(self.x * scalar, self.y * scalar, self.vx * scalar, self.vy * scalar, self.r * scalar)

    def __truediv__(self, scalar):
        return Droplet(self.x / scalar, self.y / scalar, self.vx / scalar, self.vy / scalar, self.r / scalar)

    def __floordiv__(self, scalar):
        return Droplet(self.x // scalar, self.y // scalar, self.vx // scalar, self.vy // scalar, self.r // scalar)

    def __mod__(self, other):
        return Droplet(self.x % other.x, self.y % other.y, self.vx % other.vx, self.vy % other.vy, self.r % other.r)

    def __pow__(self, exponent):
        return Droplet(self.x ** exponent, self.y ** exponent, self.vx ** exponent, self.vy ** exponent, self.r ** exponent)

    def __neg__(self):
        return Droplet(-self.x, -self.y, -self.vx, -self.vy, -self.r)

    def __abs__(self):
        return Droplet(abs(self.x), abs(self.y), abs(self.vx), abs(self.vy), abs(self.r))

    def __round__(self, ndigits=0):
        return Droplet(round(self.x, ndigits), round(self.y, ndigits), round(self.vx, ndigits), round(self.vy, ndigits), round(self.r, ndigits))

    def __trunc__(self):
        return Droplet(math.trunc(self.x), math.trunc(self.y), math.trunc(self.vx), math.trunc(self.vy), math.trunc(self.r))

    def __floor__(self):
        return Droplet(math.floor(self.x), math.floor(self.y), math.floor(self.vx), math.floor(self.vy), math.floor(self.r))

    def __ceil__(self):
        return Droplet(math.ceil(self.x), math.ceil(self.y), math.ceil(self.vx), math.ceil(self.vy), math.ceil(self.r))

    def __contains__(self, item):
        return item in (self.x, self.y, self.vx, self.vy, self.r)

