def ncr(n, r):
    if r > n:
        return 0
    if r == 0:
        return 1
    r = min(r, n - r)
    numerator = 1
    denominator = 1
    i = 0
    while i < r:
        numerator = (numerator * (n - i)) % MOD
        denominator = (denominator * (i + 1)) % MOD
        i += 1
    return (numerator * inverse(denominator)) % MOD


