        min_x = min(point[0] for point in points)
        max_x = max(point[0] for point in points)
        min_y = min(point[1] for point in points)
        max_y = max(point[1] for point in points)
        min_z = min(point[2] for point in points)
        max_z = max(point[2] for point in points)
        return min_x, max_x, min_y, max_y, min_z, max_z

    def is_balanced(point1, point2):
        min_x, max_x, min_y, max_y, min_z, max_z = find_min_max(
            [point1, point2])
        for point in points:
            if not (min_x <= point[0] <= max_x and min_y <= point[1] <=
                max_y and min_z <= point[2] <= max_z):
                return False
        return True

    def remove_points():
        pairs = []
        while len(points) > 1:
            i = 0
            while i < len(points) - 1:
                j = i + 1
                while j < len(points):
                    if not is_balanced(points[i], points[j]):
                        j += 1
                    else:
                        pairs.append((i + 1, j + 1))
                        del points[i]
                        del points[j - 1]
                        break
                i += 1
