class Solution:

    def majorityElement(self, nums: List[int]) -> List[int]:
        n = len(nums)
        threshold = n // 3
        count1 = 0
        count2 = 0
        candidate1 = None
        candidate2 = None
        for num in nums:
            if not candidate1 is None and num == candidate1:
                count1 += 1
            elif not candidate2 is None and num == candidate2:
                count2 += 1
            elif count1 == 0:
                candidate1 = num
                count1 = 1
            elif count2 == 0:
                candidate2 = num
                count2 = 1
            else:
                count1 -= 1
                count2 -= 1
        result = []
        if not candidate1 is None:
            count1 = 0
            for num in nums:
                if num == candidate1:
                    count1 += 1
            if count1 > threshold:
                result.append(candidate1)
        if not candidate2 is None:
            count2 = 0
            for num in nums:
                if num == candidate2:
                    count2 += 1
            if count2 > threshold:
                result.append(candidate2)
        return result

