def is_valid(x, y):
    if x < 0 or x >= W or y < 0 or y >= H:
        return False
    return True

def get_neighbors(x, y):
    neighbors = []
    if is_valid(x, y - 1):
        neighbors.append((x, y - 1))
    if is_valid(x, y + 1):
        neighbors.append((x, y + 1))
    if is_valid(x - 1, y):
        neighbors.append((x - 1, y))
    if is_valid(x + 1, y):
        neighbors.append((x + 1, y))
    return neighbors

def get_low_tide(x, y):
    t = (x + y * W) / (W + H)
    return 0.5 * a * (math.cos(t * 2 * math.pi / 12) + 1)

def is_safe(x, y):
    low_tide = get_low_tide(x, y)
    for nx, ny in get_neighbors(x, y):
        if grid[ny][nx] >= low_tide:
            return False
    return True

def walk(x, y, distance):
    if x == W - 1 and y == H - 1:
        return distance
    if not is_safe(x, y):
        return -1
    max_distance = -1
    for nx, ny in get_neighbors(x, y):
        distance = walk(nx, ny, distance + math.sqrt((nx - x) ** 2 + (ny - y) ** 2))
        if distance != -1:
            max_distance = max(max_distance, distance)
    return max_distance
