def solve():
    n = int(input())
    edges = []
    for _ in range(n - 1):
        u, v = map(int, input().split())
        edges.append((u, v))
    parent = [0] * (n + 1)
    depth = [0] * (n + 1)
    def dfs(node, par):
        parent[node] = par
        for child in edges:
            if child[0] != par:
                if child[1] != par:
                    depth[child[0]] = depth[node] + 1
                    dfs(child[0], node)
                else:
                    depth[child[1]] = depth[node] + 1
                    dfs(child[1], node)
    dfs(1, 0)
    def lca(u, v):
        if depth[u] > depth[v]:
            u, v = v, u
        for i in range(19, -1, -1):
            if depth[u] - (1 << i) >= depth[v]:
                u = parent[u]
        if u == v:
            return u
        for i in range(19, -1, -1):
            if parent[u] != parent[v]:
                u = parent[u]
                v = parent[v]
        return parent[u]
    def dist(u, v):
        return depth[u] + depth[v] - 2 * depth[lca(u, v)]
    ans = 0
    for i in range(1, n):
        for j in range(i + 1, n):
            if dist(i + 1, j + 1) > 2:
                ans += 1
    print(ans)

